          "localized": {
            "title": "Queer Culture 1980s–2021, The Fairy Butch Dynasty Den of Iniquity w/Founder, Karlyn Isaac Lotney",
            "description": "In this 1-hour conversation, Karlyn Isaac Lotney and I navigate the terrains and history of his Facebook community which has over 3.5K members, The Fairy Butch Dynasty Den of Iniquity! He is also a writer, educator, and performer. \n\nWhen I first met Karlyn, I approached him to have this conversation to help with some friction in his group based on culturally insensitive and disrespectful posts that had accidentally gone up. I had just had a conversation with Lily Zheng all on cancel culture and purity politics and how to allow for a careful and critical code of discourse. What I know is Fairy Butch has helped me recently navigate the LGBTQIA+ world with Karlyn's curating of queer content. And  so we discuss how the group offers political-personal growth with a progressive angle. Karlyn Isaac Lotney's approach is to bring unity, critical conversation (and also respect), and self-love to the LGBTQIA+, BLM, and GNC communities, among others.  \n\nWhat I gathered from that initial conversation with Karlyn was such a brilliant mind and also the invaluable experience of him being a trans man who has been a leading voice in SF's queer community since the 1980s! This includes his history as a dyke and involvement with On Our Backs, the legendary lesbian magazine that was released as an anthology many years later, sex positivity, queer cabarets, and queer sex education. We talk about the differences in queer LGBTQ culture until now, and how radical, underground, and punk the culture was back then. And how precious resources were for us queers. \n\nNow, The Fairy Butch group has gone online. And we discuss the differences between then and now with the Facebook group. We learn about his biography, goals for the group, and what he hopes will be the legacy of the group. \n\nUnedited conversation, to keep with the DIY punk theme of the talk when zines (underground self-made magazines) were raw, shocking, and in-your-face stories from queers who were at the front lines of society's harshest treatment! I love this talk!\n\nJOIN US for this deep dive of how the Fairy Butch group is a hub of queer culture history until NOW. We tell stories about how we survived in the 1980s and 1990s, and used creative means to form community and to heal ourselves and facilitate that for others. \nLEARN all about how to support and participate more with the The Fairy Butch Dynasty Den of Iniquity toward the end of the talk!\n\nAnd please subscribe to my channel, the Dr. Shannon Wong Lerner YouTube channel that has a lot of other content we create to support QPoC and GNC individuals. Even though we create everything for FREE, we could use more subscribers. It helps with access and visibility if you like what you see, to subscribe. Thanks!\n\nLove,\nDr. Shannon, Host of The Intersection: Diverse Folx Converse, Programming made by and for QPoC and GNC individuals"
          },
