          "description": "Looking to build muscle? Gain strength? Lose fat? I offer 1-on-1 tailored coaching online. Satisfaction guaranteed. If you’d like to learn more or get in touch with me, head over to:\nhttps://www.tytaniumfitness.com/\n\nI also publish a free informational newsletter every week. \nText 'TYTANIUM' to 22828 to subscribe. \n\nFollow me on Instagram:\n@tyleryasuda\n\n\nCHALLENGE RULES\nWorkout outline:\n3.5 mile run \n50 pushups\n1/8 mile run\n50 crunches\n1/8 mile run\n50 jump squats\n1/8 mile run\n50 push ups\n1/8 mile run\n50 crunches\n1/8 mile run\n50 jump squats\n1/8 mile run\n\nRun standard: In order to keep this fair, no treadmills allowed. You'll need to use a GPS-based app to keep track of distances. I'd recommend Nike Run Club. It's fairly simple to use and you can set up time call-outs and distance goals to keep track of pacing.\n\nPush up standard: Maintain a straight line from shoulder to hip to knee to ankle. Some part of your torso needs to touch the ground at the bottom of each rep. Elbows fully extended at the top.\n\nCrunch standard: Knees bent, feet on the ground. Hands stay on top of your head. Your upper back and shoulder blades should lift off the ground as you contract your abs. Not to be confused with a sit up, where your entire torso would leave the ground.\n\nJump squat standard: Propel yourself off the ground high enough that your legs have to work in order to catch you at the bottom. We can't practically implement a height standard, so you'll have to keep yourself honest here.\n\nComplete this workout exactly as prescribed as fast as you can. Through the rest of October, the person who submits the fastest verifiable time will win a whole month of coaching - weekly video calls and custom programming included. \nIn order to be eligible, your submission must include:\n- Screenshots of GPS and time data from the runs\n- Videos of at least one round of each exercise. Upload your video(s) to YouTube.\n- Total time for the entire workout from the start to finish. This includes any rest time and time transitioning from one part of the workout to the next (Your timer should start at the beginning of the 3.5 miles and stop at the end of the final 1/8 mile).\n\nYou're free to include more footage or relevant information that might make it easier to trust your submission. If there's any doubt as to the legitimacy of anyone's time, they will be disqualified.\n\nIf you're already on the team, you cannot use this toward your existing contract, but you may gift a friend a month of coaching. If someone on our team posts the fastest time, I'll choose a second winner amongst the other entries.\n\n\nMUSIC\nCartoon - On & On (feat. Daniel Levi)\nTime Out - Atch\nSoar - Scott Buckley\nWhen You Realize - Mauro Somm\nBe Mine - Amine Maxwell",
